import React from "react";
import "./CircleProgressBar.css";

const CircleProgressBar = ({ percentage }) => {
  return (
    <div className="circle-progress-bar">
      <div className="circle-progress-bar__background"></div>
      <div
        className="circle-progress-bar__fill"
        style={{ transform: `rotate(${percentage * 3.6}deg)` }}
      ></div>
      <div className="circle-progress-bar__percentage">{percentage}%</div>
    </div>
  );
};

export default CircleProgressBar;
